export default function ValidAccount(masukData) {
    const getValidation = async (data) => {
        try {
            const response = await fetch("localhost:8000/api/usertinknet?username="+data["username"]+"&password="+data["password"]);
            const json = await response.json();
            localStorage.setItem("token", json.token);
            window.location.replace("home");
        } catch(error) {
            alert(error);
        }
    }

    return getValidation(masukData);
}
